/* eslint-disable no-unused-vars */
import React from 'react';
import './playWindow.css';

function Play (props) {
    return (
        <div className="row">
            <div className="col-md-2"></div>
            <div className="col-md-8">
                <img className="pictures" src={props.image} id={props.id} status={props.status} alt="my-pic"></img>
            </div>
            <div className="col-md-2"></div>
        </div>
    );
}

export default Play;
